import {Redirect} from 'react-router-dom';
import {useAuth} from 'hooks/use-auth';

const HomePage = () => {
    const {isAuth, email} = useAuth();
    return isAuth ? (
    <div>
    <h2>OK!</h2>
    </div>
    ) : (
        <Redirect to="/login"/>
    )
}

export default HomePage;
